import React, { Component } from 'react';
import reactDOM from 'react-dom';
import {Link} from 'react-router-dom';

export default class Form extends Component{
    constructor(props){
        super(props)
    }
    render()
    {
        return(
            <form>
                <input type="text" placeholder="first name"/><br/>
            </form>
        )
    }
}
